import React from 'react'
import './styles/App.css'

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar__links">
                <Link to="/about">Про сайт</Link>
                <Link to="/posts">Пости</Link>
            </div>
        </div>
    )
}

export default Navbar;
